import React from 'react'
import { View, Text,StyleSheet ,ScrollView} from 'react-native'


const CategoryScreen = () => {
    return (
        <View style={{flex:1}}>
            <ScrollView>
           <Text>Category</Text>
            </ScrollView>
        </View>
    )
}



export default CategoryScreen
